import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  return <div>

    <h2>{props.name}</h2>
    <img
      src={props.src}
      alt={props.alt}
    />
    <p>{props.tel}</p>
    <p>{props.email}</p>
  </div>
}

